import Footer from '../src/components/Footer';
import Projects from '../src/components/Projects';

function App() {
  const pages = [<About />, <Contact />, <Projects />]
  const [currentPage, setCurrentPage] = useState(pages[0])
  const name = 'John Nguyen'

  return (
    <div className="App">
     <h1>Hello {name}</h1>
     {currentPage}
    </div>
  );
}

export default App;
